import React from 'react';


const Homeheader = () => {
    return (
        <h1 className="header--text">Hi there, my name is Pedraam. Thanks for stopping by!<br/><br/>Take a look inside to learn a bit about me and see some things I've done within CS.<br/><br/>If you would like to contact me, the best way to get ahold of me is to email at pedraam@berkeley.edu.</h1>
    )
}

export default Homeheader;
